import React from 'react';
import './Auth.scss';
import Input from './Input';

class NewAuth extends React.Component {
    render() {
        return (
            <form className="auth-form">
                <Input label="Имя пользователя" name="login" />
                <Input label="Пароль" name="password" />
                <Input label="Повторить пароль" name="password-repeat" />
                <input type="submit" value="Регистрация" className="auth-button" />
            </form>
        )
    }
}

export default NewAuth;
